import '../css/home.css'
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Map from './map';

function Home() {
  return (
    <div>
       <nav className='navbar'>
        <ul className="nav-list">
            <img src="" alt="LOGO" />
            <li>Home</li>
            <li>About</li>
            <Route path="Map" element={<Map />} />
        </ul>
       </nav>
       <div className='main'>

       </div>
    </div>
  );
}

export default Home;
